//	public class Solution {
	public static void main(String[] args) throws Exception {
//		System.setIn(new FileInputStream("res/input.txt"));
//		InputStream input = Solution_기본.class.getResourceAsStream("jump.txt");
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
//		br = new BufferedReader(new StringReader(src));
		StringTokenizer st;

		for (int tc = 1; tc <= 10; tc++) {
			N = Integer.parseInt(br.readLine());
			ans = 0;
			map = new int[100][100];
			q = new LinkedList<>();
			for (int i = 0; i < 100; i++) {
				st = new StringTokenizer(br.readLine());
				for (int j = 0; j < 100; j++) {
					map[i][j] = Integer.parseInt(st.nextToken());
					if (i == 99 && map[i][j] == 1) {
						boolean[][] visit = new boolean[100][100];
						visit[i][j] = true;
						q.add(new Node(i, j, visit));
					}
				}
			}
			bfs();
			System.out.println("#" + tc + " " + ans);
		}
	}

	static void bfs() {
		while (!q.isEmpty()) {
			Node tmp = q.poll();
//			System.out.println(tmp);
			if (tmp.x == 0) {
				ans=tmp.y;
//				System.out.println(tmp.y);
				return;
			}
			boolean flag = false;
			for (int i = 0; i < 2; i++) {// 좌우 갈수있으면
				int cx = tmp.x + dx[i];
				int cy = tmp.y + dy[i];
				if (cx < 0 || cy < 0 || cx >= 100 || cy >= 100) {
					continue;
				}
				if (tmp.visit[cx][cy])
					continue;
				if (map[cx][cy] == 1) {
					tmp.visit[cx][cy] = true;
					q.offer(new Node(cx, cy, tmp.visit));
					tmp.visit[cx][cy] = false;
					flag = true;
//					visit[cx][cy] = false;
				}
			}
			if (!flag) {
				int cx = tmp.x + dx[2];
				int cy = tmp.y + dy[2];
				if (cx < 0 || cy < 0 || cx >= 100 || cy >= 100) {
					continue;
				}
				if (tmp.visit[cx][cy])
					continue;
				if (map[cx][cy] == 1) {
					tmp.visit[cx][cy] = true;
					q.offer(new Node(cx, cy, tmp.visit));
					tmp.visit[cx][cy] = false;
				}
			}
		}

	}

	static int N, ans;
	static int[][] map;
	static int[] dx = { 0, 0, -1 };
	static int[] dy = { -1, 1, 0 };
	static Queue<Node> q;

	static class Node {
		int x;
		int y;
		boolean visit[][] = new boolean[100][100];

		public Node(int x, int y, boolean[][] visit) {
			super();
			this.x = x;
			this.y = y;
			for (int i = 0; i < 100; i++) {
				for (int j = 0; j < 100; j++) {
					this.visit[i][j] = visit[i][j];
				}
			}
		}

		@Override
		public String toString() {
			return "Node [x=" + x + ", y=" + y + "]";
		}

	}

